import React from 'react';
import { Provider } from 'react-redux';
import Layout from './components/Layout';
import ProceduresPage from './components/ProceduresPage';
import './index.css';
import store from './store';

const App = () =>
  <Provider store={store}>
    <Layout>
      <ProceduresPage />
    </Layout>
  </Provider>

export default App;
